list.item:
Diclofenac sodium delayed-release tablets are contraindicated for the treatment of perioperative pain in the setting of coronary artery bypass graft (CABG) surgery (see 
                           WARNINGS
                        ).

								NSAIDs cause an increased risk of serious gastrointestinal adverse events including inflammation, bleeding, ulceration, and perforation of the stomach or intestines, which can be fatal. These events can occur at any time during use and without warning symptoms. Elderly patients are at greater risk for serious gastrointestinal events. (See 
                           WARNINGS
                        ).

text.paragraph:
Carefully consider the potential benefits and risks of diclofenac sodium delayed-release tablets and other treatment options before deciding to use diclofenac sodium delayed-release tablets. Use the lowest effective dose for the shortest duration consistent with individual patient treatment goals (see 
                        WARNINGS
                     ).

